import React  from 'react';
import logo from './logo.svg';
import './App.css';
import Home from './Home';
import Navbar from './Navbar';
import {Swicth, Route , Redirect} from 'react-router-dom';


function App() {
  return (

    <>
    <Navbar />
    <Switch>
    <Route exact path='/' component={Home}></Route>
    <Redirect to="/" />
    </Switch>

    </>

  );
}

export default App;
